dwarf doesn't have tuples (yet) so we'll use structs like so: struct Complex { re: float, im: float,
} This is how we declare a user defined type in dwarf. It's the keyword struct followed by the name of the type, and then a block of fields. Each field in the block is a name followed by a type, separated by a colon. Each field is separated from another by a comma. Trailing commas are just fine. In this specific case we have a struct called Complex that has two fields, each of type float . The first is called re, and the second, im. Initializiation of a struct is done by a struct expression , just like Rust. if you are unfamiliar, a struct expression looks like the definition, but with values in place of types. #struct Complex {
# re: float,
# im: float,
#}
fn main() { let z = Complex { re: 1.23, im: 4.56, }; chacha::assert_eq(z.re, 1.23); chacha::assert_eq(z.im, 4.56);
} The last two lines are functions provided by the runtime ChaCha. chach::assert_eq tests it's arguments for equality, and throws an error if they are not.

