Having a type is a good start. We can now create Complex numbers Addition is fairly straightforward: # struct Complex {
# re: float,
# im: float,
# } impl Complex { fn add(self, other: Complex) { self.re = self.re + other.re; self.im = self.im + other.im; }
} This is an impl block. Functions that belong to the struct go into the impl block. Similarly, the square function is not too bad: # struct Complex {
# re: float,
# im: float,
# } impl Complex { fn square(self) { self.re = self.re * self.re - self.im * self.im; self.im = 2.0 * self.re * self.im; }
} Earlier I said that you know if you are in the set if you don't go to infinity and beyond. We don't have that much time, and there's a shortcut. While we are iterating, we can just check the absolute value of the complex number. If it is greater than 2 then we know that the number will go to infinity. When that happens we know that we are not in the set. Rather than check the absolute value, we can just check of the value is greater than 4. The problem of course is that 4 is a scalar, and we are dealing with complex numbers. The solution is to take the norm , or dot product of the complex number. # struct Complex {
# re: float,
# im: float,
# } impl Complex { fn norm(self) -> float { self.re * self.re + self.im * self.im }
} There is something worth noting in the last function. We are returning a float , but there is no return statement. Just like in Rust, the last expression in a block is the the value of the block. We'll need to be able to create the Complex number "0". We can do that with a static method . Static methods are functions that belong to the type, rather than an instance of the type. Practically that means that the function does not take a self parameter. #struct Complex {
# re: float,
# im: float,
#} impl Complex { fn zero() -> Complex { Complex { re: 0.0, im: 0.0, } }
} fn main() { let zero = Complex::zero(); chacha::assert_eq(zero.re, 0.0); chacha::assert_eq(zero.im, 0.0);
}

